import React from 'react'
import Records from './data.json'

const Afterlogin = () => {
  return (
    <div>
      {
        Records.map( record =>{
            return(
                <div className='table'>
                    {record.name}
                </div>
            )
        } )
      }
    </div>
  )
}

export default Afterlogin
